          "message": "Patch Set 9:\n\nIt WILL break the HEAT jobs in OpenDaylight. So we need to coordinate the release with OpenDaylight. I\u0027m not expecting another lftools release for awhile so we got time to coordinate that. It\u0027s safe to merge into master."
