          "message": "Patch Set 9: Code-Review+2\n\n\u003e It WILL break the HEAT jobs in OpenDaylight. So we need to\n \u003e coordinate the release with OpenDaylight. I\u0027m not expecting another\n \u003e lftools release for awhile so we got time to coordinate that. It\u0027s\n \u003e safe to merge into master.\n\nOk, then merging :)"
