        {
          "timestamp": 1529357336000,
          "reviewer": ids["askb"],
          "message": "Patch Set 1:\n\n\u003e \u003e Patch Set 1: Code-Review+1\n \u003e \n \u003e Anil, if we only +1 patches, it blocks us from being able to merge\n \u003e the patch if we want to because of NACR. I think it would be better\n \u003e if we +2\u0027d patches that are not our own so that the team can merge\n \u003e the patch if they want to.\n\nThanh: Do you realize that you had -2 the change so that it does not get merged?"
        },
        {
          "timestamp": 1529357454000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 1:\n\n\u003e Thanh: Do you realize that you had -2 the change so that it does\n \u003e not get merged?\n\nYes, I blocked my own patch so that we don\u0027t accidentally merge it. However I need someone who is NOT me to +2 the patch so when I\u0027m ready to merge I can click the merge button.\n\nMy vote does not count towards NACR."
        }
