          "comments": [
            {
              "file": "jjb/lf-macros.yaml",
              "line": 465,
              "reviewer": ids["askb"],
              "message": "would this break existing jobs if npmrc does not exist, since we are using this wrapper all over ODL\u0027s releng/builder jobs?",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 465,
              "reviewer": ids["zxiiro"],
              "message": "I think this is a setting that we should require all CI to configuration. So it should be documented in the README (although we should probably move that README to rst in another patch)",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 465,
              "reviewer": ids["jeremyphelps"],
              "message": "It will require that a file called npmrc exists, I\u0027ve added docs to explain.",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 485,
              "reviewer": ids["askb"],
              "message": "Is this config file read by default? Do we need to add any option while doing npm install?",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 485,
              "reviewer": ids["zxiiro"],
              "message": "It needs to go into $HOME/.npmrc just like it is done here:\n\n https://github.com/opendaylight/releng-builder/blob/master/jjb/releng-macros.yaml#L447-L450\n\nThat way anything that calls npm will by default load configuration from that file. It\u0027s especially necessary for OpenDaylight\u0027s case where a mvn execution calls npm as part of the dlux-web build.",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 485,
              "reviewer": ids["jeremyphelps"],
              "message": "I did try $HOME and it did not work...I was under the impression that this call happens in the WORKSPACE on the build minion.",
              "patchSetTimestamp": 1508349702000
            },
            {
              "file": "jjb/lf-macros.yaml",
              "line": 485,
              "reviewer": ids["jeremyphelps"],
              "message": "Updated to use $HOME",
              "patchSetTimestamp": 1508349702000
            }
          ],
